try:
    _root = Path(__file__).resolve().parents[1] / "tenant_migrations" / "webapp-api"
    _base = _root.parent
    if _root.exists():
        for _p in _root.rglob("*"):
            if not _p.is_file():
                continue
            if "__pycache__" in _p.parts:
                continue
            _rel = _p.relative_to(_base).as_posix()
            EMBEDDED_FILES[_rel] = base64.b64encode(gzip.compress(_p.read_bytes())).decode(
                "utf-8"
            )
except Exception:
    pass
